/**
 * 存在显示，否则N/A
 * 入参: val
 * 出参: val or n/a
 */

export default {
    checkNan: (val) => {
        return val ? val : 'N/A';
    },
    showCurrencySymbol: (address) => {
        return address == "China" || address == "中国" ? "￥" : "$";
    }
};
